{
  "translationLines": [
    {
      "lineNumber": 19041,
      "originalJapaneseLine": "　旦那様方に、疑われています……」",
      "translatedEnglishLine": "They are being suspected by the masters..."
    },
    {
      "lineNumber": 19042,
      "originalJapaneseLine": "「っ、そんな……」",
      "translatedEnglishLine": "T-That can't be..."
    },
    {
      "lineNumber": 19043,
      "originalJapaneseLine": "「……離れた所で、会えませんか？",
      "translatedEnglishLine": "...Can we meet somewhere secluded?"
    },
    {
      "lineNumber": 19044,
      "originalJapaneseLine": "　街はずれの、小屋とか……二人きり」",
      "translatedEnglishLine": "Like at a cabin on the outskirts of town... just the two of us."
    },
    {
      "lineNumber": 19045,
      "originalJapaneseLine": "「二人きり……うん……うん。そうしましょう。",
      "translatedEnglishLine": "Just the two of us... yeah... yes, let's do that."
    },
    {
      "lineNumber": 19046,
      "originalJapaneseLine": "　素敵だわ」",
      "translatedEnglishLine": "That's wonderful."
    },
    {
      "lineNumber": 19047,
      "originalJapaneseLine": "「気をつけて下さいね……",
      "translatedEnglishLine": "Please be careful..."
    },
    {
      "lineNumber": 19048,
      "originalJapaneseLine": "　お嬢様が外出したと判明したら……」",
      "translatedEnglishLine": "If it becomes known that the young lady went out..."
    },
    {
      "lineNumber": 19049,
      "originalJapaneseLine": "「大丈夫よ。",
      "translatedEnglishLine": "It'll be fine."
    },
    {
      "lineNumber": 19050,
      "originalJapaneseLine": "　絶対に見つからないようにできるわ。",
      "translatedEnglishLine": "I can make sure you absolutely won't be found."
    },
    {
      "lineNumber": 19051,
      "originalJapaneseLine": "　私、そういうの得意なの。ふふふ」",
      "translatedEnglishLine": "I'm good at things like that. Hehehe."
    },
    {
      "lineNumber": 19052,
      "originalJapaneseLine": "「えぇ……お嬢様は賢くていらっしゃいますから。",
      "translatedEnglishLine": "Yes... The young lady is very clever."
    },
    {
      "lineNumber": 19053,
      "originalJapaneseLine": "　よろしくお願いしますよ……」",
      "translatedEnglishLine": "I’m trusting you with this..."
    },
    {
      "lineNumber": 19054,
      "originalJapaneseLine": "――――少女の年不相応の知性を押し流したのは、",
      "translatedEnglishLine": "――――What overcame the girl's unseasonal intelligence was,"
    },
    {
      "lineNumber": 19055,
      "originalJapaneseLine": "年相応の恋心だった。",
      "translatedEnglishLine": "A love matching her age."
    },
    {
      "lineNumber": 19056,
      "originalJapaneseLine": "丁寧に痕跡を消して屋敷を出た少女を、",
      "translatedEnglishLine": "The girl, who carefully erased all traces and left the mansion,"
    },
    {
      "lineNumber": 19057,
      "originalJapaneseLine": "小屋で待っていたのは――――",
      "translatedEnglishLine": "Was awaited at the cabin――――"
    },
    {
      "lineNumber": 19058,
      "originalJapaneseLine": "「……………………」",
      "translatedEnglishLine": "........................"
    },
    {
      "lineNumber": 19059,
      "originalJapaneseLine": "「はい……じゃあ、この額で納めさせて頂きます」",
      "translatedEnglishLine": "Yes... then I will settle with this amount."
    },
    {
      "lineNumber": 19060,
      "originalJapaneseLine": "「あら……でもこれ……少なくないですか？」",
      "translatedEnglishLine": "Oh... but isn’t this a bit too little?"
    },
    {
      "lineNumber": 19061,
      "originalJapaneseLine": "「えぇっ？　……わ、本当だ。",
      "translatedEnglishLine": "Eh? ...Oh, it really is."
    },
    {
      "lineNumber": 19062,
      "originalJapaneseLine": "　これじゃ私、社長に叱られちゃうな」",
      "translatedEnglishLine": "At this rate, the president will scold me."
    },
    {
      "lineNumber": 19063,
      "originalJapaneseLine": "「ふふ、直しておきますね」",
      "translatedEnglishLine": "Hehe, I’ll fix it for you."
    },
    {
      "lineNumber": 19064,
      "originalJapaneseLine": "「いやあ……すみません。",
      "translatedEnglishLine": "Ah... sorry about that."
    },
    {
      "lineNumber": 19065,
      "originalJapaneseLine": "　これはメイドさんの顔を見てたせいですね」",
      "translatedEnglishLine": "I was probably distracted by looking at the maid's face."
    },
    {
      "lineNumber": 19066,
      "originalJapaneseLine": "「え…………」",
      "translatedEnglishLine": "Eh..."
    },
    {
      "lineNumber": 19067,
      "originalJapaneseLine": "「じゃあ、失礼します。",
      "translatedEnglishLine": "Well then, excuse me."
    },
    {
      "lineNumber": 19068,
      "originalJapaneseLine": "　また来ますから」",
      "translatedEnglishLine": "I’ll come again."
    },
    {
      "lineNumber": 19069,
      "originalJapaneseLine": "業者の男は去っていった。",
      "translatedEnglishLine": "The man from the contractor left."
    },
    {
      "lineNumber": 19070,
      "originalJapaneseLine": "「………………」",
      "translatedEnglishLine": ".................."
    },
    {
      "lineNumber": 19071,
      "originalJapaneseLine": "「…………顔なじみなの？」",
      "translatedEnglishLine": "...Do you know him?"
    },
    {
      "lineNumber": 19072,
      "originalJapaneseLine": "「ああ、カチューシャさん……はい。",
      "translatedEnglishLine": "Ah, Katusha... yes."
    },
    {
      "lineNumber": 19073,
      "originalJapaneseLine": "　業者さんです。面白い人なんですよ」",
      "translatedEnglishLine": "He’s a contractor. Quite an interesting person."
    },
    {
      "lineNumber": 19074,
      "originalJapaneseLine": "「一生懸命で、なんだか少し優しくて。",
      "translatedEnglishLine": "He's hardworking and somehow a little kind."
    },
    {
      "lineNumber": 19075,
      "originalJapaneseLine": "　それで……」",
      "translatedEnglishLine": "And then..."
    },
    {
      "lineNumber": 19076,
      "originalJapaneseLine": "「少し抜けてて憎めない？」",
      "translatedEnglishLine": "A little scatterbrained, but you can’t hate him, right?"
    },
    {
      "lineNumber": 19077,
      "originalJapaneseLine": "「あっ、そうですね。そんな感じです」",
      "translatedEnglishLine": "Ah, yes. That’s exactly it."
    },
    {
      "lineNumber": 19078,
      "originalJapaneseLine": "「ふーん…………そ」",
      "translatedEnglishLine": "Hmm... I see."
    },
    {
      "lineNumber": 19079,
      "originalJapaneseLine": "「あっ…………？　行っちゃった……」",
      "translatedEnglishLine": "Ah...? He’s gone..."
    },
    {
      "lineNumber": 19080,
      "originalJapaneseLine": "「さ。私もお掃除お掃除」",
      "translatedEnglishLine": "Well then. I should do some cleaning too."
    },
    {
      "lineNumber": 19081,
      "originalJapaneseLine": "「ふぅ……今度のあのメイドは意外と悪くないな……",
      "translatedEnglishLine": "Phew... That maid this time isn’t so bad..."
    },
    {
      "lineNumber": 19082,
      "originalJapaneseLine": "　なんせ人類軍の本拠地だしな。",
      "translatedEnglishLine": "After all, it’s the main base of the Human Army."
    },
    {
      "lineNumber": 19083,
      "originalJapaneseLine": "　面白いネタのひとつやふたつくらい……",
      "translatedEnglishLine": "I might get one or two interesting stories..."
    },
    {
      "lineNumber": 19084,
      "originalJapaneseLine": "「わっ……！？」",
      "translatedEnglishLine": "Wah...!?"
    },
    {
      "lineNumber": 19085,
      "originalJapaneseLine": "「あっ……す、すみません」",
      "translatedEnglishLine": "Ah... I-I'm sorry."
    },
    {
      "lineNumber": 19086,
      "originalJapaneseLine": "「い、いやこちらこそ。",
      "translatedEnglishLine": "N-no, it’s me who should say that."
    },
    {
      "lineNumber": 19087,
      "originalJapaneseLine": "　大丈夫ですか…………っ、え……！？",
      "translatedEnglishLine": "Are you alright...? Eh...!?"
    },
    {
      "lineNumber": 19088,
      "originalJapaneseLine": "「ご丁寧にありがとうございます……",
      "translatedEnglishLine": "Thank you very much for your kindness..."
    },
    {
      "lineNumber": 19089,
      "originalJapaneseLine": "　あの、何か……？」",
      "translatedEnglishLine": "Um, is there something...?"
    },
    {
      "lineNumber": 19090,
      "originalJapaneseLine": "「い、いや……どこかで、見たような……」",
      "translatedEnglishLine": "N-no... I feel like I’ve seen you somewhere before..."
    }
  ]
}

